import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron'
import Container from 'react-bootstrap/Container'
import './Footer.css'


const Footer = () => {
    return (
        <div>
            <Jumbotron className="Jumbo4" fluid>
                <Container>
                    <h1>
                        Everything 

                    </h1>

                </Container>
            </Jumbotron>
        </div>
    );

}

export default Footer;
